    private static byte[] LoadRandom(double chance = 0.15)
    {
        var rand = new Random();
        var cells = new byte[ROWS * COLS];

        for (int r = 0; r < ROWS; r++)
            for (int c = 0; c < COLS; c++)

                if (rand.NextDouble() < chance)
                {
                    cells[r * COLS + c] = 1;
                }
                else
                {
                    cells[r * COLS + c] = 0;
                }



        return cells;
    }


